import React from 'react';
import Carousel from './components/Carousel';

function App() {
  const images = [
    'https://via.placeholder.com/800x400',
    'https://via.placeholder.com/800x400',
    'https://via.placeholder.com/800x400',
  ];

  return (
    <div className="App">
      <h1 className="text-4xl font-bold text-center my-8">My Carousel App</h1>
      <Carousel images={images} />
    </div>
  );
}

export default App;
